const ArchiveLocations= ({locations, lang}) => {

    return (
      <nav className="archive__locations">
        <ul>
          {
            locations.map((city) => (
              <li className="archive__locations__city">{city}</li>
            ))
          }
        </ul>
      </nav>
    )
  }

  export default ArchiveLocations
